import React, { Fragment, useNaviagte } from "react";
import image from '../assents/notification-icons.png'
import People from "../Sidebar/People";
import SideBar from "../Sidebar/sideBar";
import Button from "../UI/Button/Button";
// import Input from "../UI/Input/Input";
import classes from "./Deshboard.module.css";

export default function Dashboard(props) { 
  const navigate = useNaviagte();
  return (
    <Fragment>
      <div className={classes.dashboard}>
        <h1>Dashboard</h1>
        {/* <span>39 People</span> */}
        {/* <Input /> */}
        <div >
        <img src={image}/>
        <button onClick={()=>{
          navigate('/');
        }} >Logout</button>
        </div>
      </div>
      <SideBar/>
    </Fragment>
  );
}
